import React from 'react';
import './App.css';

class App extends React.Component {

	render() {	
	  return (
	    <>
        <div className="container-fluid">
		    <div className="row">
			    <div className="col-9 col1">
			      1 of 2
			    </div>
			    <div className="col col2">
			      2 of 2
			    </div>
			</div>
		</div>
	    </>
	  );
	}
}

export default App;
